import React from 'react'

const NoteItem = (props) => {
    const { note } = props;
    return (
        <div className='col-md-3 '>
            <div class="card">
                <div class="card-header">
                    {note.title}
                </div>
                <div class="card-body">
                    <h5 class="card-title">Card title</h5>
                    <p class="card-text">{note.description}</p>
                </div>
            </div>

        </div>
    )
}

export default NoteItem
